myNet = fromList (read netString) :: NN Double

getMFCC _ rndStr [] = do
  callCommand ("rm "++"./"++rndStr++".wav")
  return ([])
getMFCC input rndStr (s:sx) = do
  let tempfile = makeW input s
  let name = "./"++rndStr++".wav"
  putWAVEFile name tempfile
  mfcc <- readProcess "python" ["mfcc_file.py",name] "" >>= return.unwords.lines >>= return.(map read).words
  --readProcess "python" ["mfcc_file.py",name] ""
  down <- getMFCC input rndStr sx
  return (mfcc:down)
  
operation _ [] = []
operation cant (x:xs)
  | (length xs) < cant = [x+(sum (take (cant-1) xs))]
  | otherwise = (x+(sum (take (cant-1) xs))):(operation cant xs)

operation2 fracks max (l1:lx1) (l2:lx2)
  | max == l1 = concat $ l2:(take (fracks - 1) lx2)
  | otherwise = operation2 fracks max lx1 lx2

main = do
  (file:fracks:outFiles:_) <- getArgs 
  stdgen <- getStdGen
  let rndStr = take 15 $ randomRs ('a','z') stdgen

  input <- getWAVEFile file
  let samples = map head $ waveSamples input
  let splited = takeIf (\x->(length x)==1600) $ chunksOf 1600 samples
  if ((length splited) >= (read fracks)) then do
    mfcc <- getMFCC input rndStr splited
    let voice = map head $ map (solve myNet) mfcc
    let frackVal = operation (read fracks) voice
    putWAVEFile outFiles (makeW input (operation2 (read fracks) (maximum frackVal) frackVal splited))
  else putWAVEFile outFiles input













